sys_variable_value.value:
(function execute(inputs, outputs) {
  var stream = sn_fd.FlowAPI.executeDataStreamAction('sn_gpdisk_spoke.list_images', {
        "project_id": inputs.projectid
    });
    var obj = []
    while (stream.hasNext()) {
        obj.push(stream.next())
    }
    var images = [];
    obj.forEach(function(imageObj) {
        images.push({
            "label": imageObj.name.toUpperCase(),
            "name": imageObj.name
        });
    })
    outputs.images = {
        data: images
    }
})(inputs, outputs);

